const kb = new Keyboard({ lang: 'ru' });
const input = document.getElementById('value');
const searchBtn = document.querySelector('.search-form .btn-search');
const settingsBtn = document.querySelector('.search-form .btn-settings');
const closeBtn = document.querySelector('.search-form .btn-close');
const portalBtn = document.querySelector('.search-form .btn-portal');
searchBtn.addEventListener('click', (e) => {
	doSearch();
});
settingsBtn.addEventListener('click', (e) => {
	keyboard();
});
closeBtn.addEventListener('click', (e) => {
	doClose();
});
portalBtn.addEventListener('click', (e) => {
	doPortal();
});
kb.addEventListener(Keyboard.E_KEYPRESS, (e) => {
  console.log(e);
  if (e.key) {
    input.value += e.key;
  }
});
kb.addEventListener(Keyboard.E_CLEAR_ALL, () => {
  input.value = '';
});
kb.addEventListener(Keyboard.E_BACKSPACE, () => {
  input.value = input.value.substring(0, input.value.length - 1);
});
kb.addEventListener(Keyboard.E_SElECT_ALL, () => {
  input.select();
});
kb.addEventListener(Keyboard.E_ENTER, () => {
  try {
	  doSearch();
  } catch (e) {
	  alert(e);
  }
});
function updateSkin(skinId) {
	kb.setSkin(skinId);
}
document.addEventListener('readystatechange', () => {
	if (document.readyState === 'complete') {
		let inter = setInterval(() => {
			if ('CHtmlDialog' in window) {
				clearInterval(inter);
				window.CHtmlDialog.callLua('update_skin').then(() => {
					kb.keyboard.classList.add('ready');
				});
			}
		}, 100);
	}
});
window.addEventListener('resize', () => {
	kb.scale(window.innerWidth / 1000);
});